export default function ElectricityText({text,endText}) {
  return (
    <div className="flex-jstfy-cent" id="electricity-txt-container">
    { text!=undefined && <h1 className="large-txt inline no-margin">{text} </h1> }
    <img src="/icons/currency.png" id="currency-icon" ></img>
    { endText && <h1 className="large-txt inline no-margin">{endText} </h1> }
    </div>     
  )
}
